import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('form#loginForm');

    // Input email and password
    await page.fill('#email', 'your_email@example.com'); // Replace with actual email
    await page.fill('#password', 'your_password'); // Replace with actual password

    // Take screenshot after filling credentials
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_credentials.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_credentials.png'));

    // Click the login button
    await page.click('button.login-btn');

    // Wait for navigation or content load after login
    await page.waitForLoadState('networkidle');

    // Take screenshot after login
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_login.png'));

    // Search message history for a keyword
    const keyword = 'your_keyword'; // Replace with the keyword to search
    await page.fill('input[placeholder="Search messages"]', keyword); // Adjust selector as necessary
    await page.keyboard.press('Enter');

    // Wait for search results to load
    await page.waitForSelector('.search-results'); // Adjust selector as necessary

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results.png'));

    return {
      success: true,
      action: "Searched message history for the keyword",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

