import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('form#loginForm');

    // Enter login credentials
    await page.fill('#email', 'test@example.com'); // Using ID selector for email
    await page.fill('#password', 'password123'); // Using ID selector for password

    // Click the login button
    await page.click('button.login-btn');

    // Wait for potential error message to appear
    await page.waitForSelector('.error-message', { timeout: 5000 }).catch(() => {});

    // Take screenshot after login attempt
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_login_attempt.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_login_attempt.png'));

    // Check if login was successful by verifying the existence of a user-specific element
    const isLoggedIn = await page.$('selector-for-user-specific-element') !== null;

    // Extract meaningful data
    const extractedData = isLoggedIn ? { message: "Login successful" } : { message: "Login failed" };

    return {
      success: isLoggedIn,
      action: isLoggedIn ? "Successfully logged in to Facebook" : "Failed to log in",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
